/**
 * Tabela que contem informacoes sobre zonas eleitorais
 * @nroZona 		  numero da zona eleitoral
 * @estadoZona 		sigla do estado da zona eleitoral
 * @endZona 	    endereco da zona eleitoral
 * @qtdEleitoresZ quantidade de eleitores inscritos na zona eleitoral ATRIBUTO DERIVADO (scriptInsere contem comando SQL para definir o valor)
 * @PK_ZONA restricao de chave primaria
 * @CHECK_NROZONA verificacao de integridade (numero da zona eleitoral tem no maximo 3 digitos)
 * @CHECK_ESTADOZONA verificacao de integridade (verifica se sigla do estado eh valida)
**/
CREATE TABLE zona(
  nroZona NUMBER NOT NULL,
  estadoZona CHAR(2) NOT NULL,
  endZona VARCHAR2(200),
  qtdEleitoresZ NUMBER DEFAULT 0,
  
  CONSTRAINT PK_ZONA PRIMARY KEY (nroZona, estadoZona),
  CONSTRAINT CHECK_NROZONA CHECK(nroZona BETWEEN 0 and 999),
  CONSTRAINT CHECK_ESTADOZONA CHECK (UPPER(estadoZona) IN ('AC', 'AL', 'AP',	'AM',	'BA',	'CE',	'DF',	'ES',	'GO',	'MA',	'MT',	'MS',	'MG',	'PA',	'PB',	'PR',	'PE',	'PI',	'RJ',	'RN',	'RS',	'RO',	'RR',	'SC',	'SP',	'SE',	'TO'))
);

/**
 * Tabela que contem informacoes sobre secoes eleitorais
 * @nroZona 		  numero da zona eleitoral a qual pertence a secao
 * @estadoZona 		sigla do estado da zona eleitoral a qual pertence a secao
 * @nroSecao      numero da secao eleitoral
 * @localSecao    local da secao eleitoral
 * @qtdEleitoresS quantidade de eleitores inscritos na secao eleitoral ATRIBUTO DERIVADO (scriptInsere contem comando SQL para definir o valor)
 * @PK_SECAO restricao de chave primaria
 * @FK_SECAO restricao de chave estrangeira - zona
 * @CHECK_NROSECAO verificacao de integridade (numero da secao eleitoral tem no maximo 4 digitos)
**/
CREATE TABLE secao(
  nroZona NUMBER,
  estadoZona CHAR(2),
  nroSecao NUMBER NOT NULL,
  localSecao VARCHAR2(200),
  qtdEleitoresS NUMBER DEFAULT 0,
  
  CONSTRAINT PK_SECAO PRIMARY KEY (nroZona, estadoZona, nroSecao),
  CONSTRAINT FK_SECAO FOREIGN KEY (nroZona, estadoZona) REFERENCES zona(nroZona, estadoZona) ON DELETE CASCADE,
  CONSTRAINT CHECK_NROSECAO CHECK (nroZona BETWEEN 0 and 9999)
);

/**
 * Tabela que contem informacoes sobre urnas eleitorais
 * @nroZona 		  numero da zona eleitoral a qual pertence a urna
 * @estadoZona 		sigla do estado da zona eleitoral a qual pertence a urna
 * @nroSecao 		  numero da secao eleitoral a qual pertence a urna
 * @nroUrna       numero da urna eleitoral
 * @modelo        modelo da urna eleitoral
 * @tipoUrna      tipo de urna eleitoral (manual ou eletronica)
 * @PK_URNA restricao de chave primaria
 * @FK_URNA restricao de chave estrangeira - secao
 * @CHECK_NROURNA verificacao de integridade (numero da urna tem no maximo 8 digitos)
 * @CHECK_TIPOURNA verificacao de integridade (se tipo da urna eh manual ou eletronica)
 * @CHECK_MODELOURNA verificacao de integridade (se tipo da urna eh eletronica, entao o modelo deve ser DRE, VVPAT, ou E2E; se eh tipo manual, o modelo deve ser nulo)
**/
CREATE TABLE urna(
  nroZona NUMBER,
  estadoZona CHAR(2),
  nroSecao NUMBER,
  nroUrna NUMBER NOT NULL,
  modelo VARCHAR2(50),
  tipoUrna VARCHAR2(15),
  
  CONSTRAINT PK_URNA PRIMARY KEY (nroZona, estadoZona, nroSecao, nroUrna),
  CONSTRAINT FK_URNA FOREIGN KEY (nroZona, estadoZona, nroSecao) REFERENCES secao(nroZona, estadoZona, nroSecao) ON DELETE CASCADE,
  CONSTRAINT CHECK_NROURNA CHECK (nroUrna BETWEEN 0 and 99999999),
  CONSTRAINT CHECK_TIPOURNA CHECK (LOWER(tipoUrna) in ('manual', 'eletronica', 'eletrônica')),
  CONSTRAINT CHECK_MODELOURNA CHECK ((LOWER(tipoUrna) in ('eletronica', 'eletrônica') AND UPPER(modelo) in ('DRE', 'VVPAT', 'E2E')) OR (LOWER(tipoUrna) in ('manual') AND modelo is NULL))
);

/**
 * Tabela que contem informacoes sobre pessoas envolvidas na eleicao
 * @nroTitEleitor numero do titulo de eleitor da pessoa
 * @nomePessoa    nome completo da pessoa
 * @endPessoa 		endereco completo da pessoa
 * @dataNasc      data de nascimento da pessoa
 * @escolaridade  escolaridade da pessoa
 * @tipoPessoa    tipo de pessoa (candidato, funcionario, ou outro)
 * @nroZona       numero da zona eleitoral onde a pessoa esta registrada
 * @estadoZona    sigla do estado da zona eleitoral onde a pessoa esta registrada
 * @nroSecao      numero da secao eleitoral onde a pessoa esta registrada
 * @PK_PESSOA restricao de chave primaria
 * @FK_PESSOA restricao de chave estrangeira - secao eleitoral
 * @CHECK_TIPO_PESSOA verificacao de integridade (se pessoa eh candidato, funcionario ou outro)
**/
CREATE TABLE pessoa(
  nroTitEleitor VARCHAR2(12) NOT NULL,
  nomePessoa VARCHAR2(100),
  endPessoa VARCHAR2(200),
  dataNasc DATE,
  escolaridade VARCHAR2(30),
  tipoPessoa VARCHAR2(11),
  nroZona NUMBER,
  estadoZona CHAR(2),
  nroSecao NUMBER,
  
  CONSTRAINT PK_PESSOA PRIMARY KEY (nroTitEleitor),
  CONSTRAINT FK_PESSOA FOREIGN KEY (nroZona, estadoZona, nroSecao) REFERENCES secao(nroZona, estadoZona, nroSecao) ON DELETE SET NULL,
  CONSTRAINT CHECK_TIPO_PESSOA CHECK (LOWER(tipoPessoa) in ('candidato', 'funcionario', 'funcionário', 'outro'))
);

/**
 * Tabela que contem informacoes sobre partidos politicos
 * @nroPartido    numero do partido politico
 * @nomePartido   nome completo do partido politico
 * @siglaPartido 	sigla do partido politico
 * @nroVotosP     numero de votos no partido politico ATRIBUTO DERIVADO (scriptInsere contem comando SQL para definir o valor)
 * @PK_PARTIDO restricao de chave primaria
**/
CREATE TABLE partido(
  nroPartido NUMBER NOT NULL,
  nomePartido VARCHAR2(100),
  siglaPartido VARCHAR2(5),
  nroVotosP NUMBER DEFAULT 0,
  
  CONSTRAINT PK_PARTIDO PRIMARY KEY (nroPartido)
);

/**
 * Tabela que contem informacoes sobre filiacoes de pessoas em partidos
 * @nroTitEleitor numero do titulo de eleitor da pessoa
