/**
 * Tabela que contem informacoes sobre candidatos
 * @nroTitEleitor numero do titulo de eleitor do candidato
 * @nomeFantasia  nome fantasia do candidato
 * @nroCandidato  numero do candidato
 * @cargoCandidato  cargo do candidato
 * @nroVotos      numero de votos obtidos pelo candidato ATRIBUTO DERIVADO (scriptInsere contem comando SQL para definir o valor)
 * @PK_CANDIDATO restricao de chave primaria
 * @FK_CANDIDATO restricao de chave estrangeira - pessoa
 * @CHECK_CARGO_CANDIDATO verificacao de integridade (se candidato concorre a prefeito, vice-prefeito, vereador, governador, vice-governador, presidente ou vice-presidente)
**/
CREATE TABLE candidato(
  nroTitEleitor VARCHAR2(12),
  nomeFantasia VARCHAR2(100),
  nroCandidato NUMBER NOT NULL,
  cargoCandidato VARCHAR2(20) NOT NULL,
  nroVotos NUMBER DEFAULT 0,
  
  CONSTRAINT PK_CANDIDATO PRIMARY KEY (nroTitEleitor),
  CONSTRAINT FK_CANDIDATO_PESSOA FOREIGN KEY (nroTitEleitor) REFERENCES pessoa(nroTitEleitor) ON DELETE CASCADE,
  CONSTRAINT FK_CANDIDATO_FILIA FOREIGN KEY (nroTitEleitor) REFERENCES filia(nroTitEleitor) ON DELETE CASCADE,
  CONSTRAINT CHECK_CARGO_CANDIDATO CHECK (LOWER(cargoCandidato) in ('prefeito', 'vice-prefeito', 'vereador', 'governador', 'vice-governador', 'presidente', 'vice-presidente')),
  CONSTRAINT UNIQUE_NROCANDIDATO UNIQUE (nroCandidato, cargoCandidato)
);

