/*************************************GATILHOS*********************************************/
/*trigger para contagem de eleitores por zona*/
CREATE OR REPLACE TRIGGER eleitores_por_zona
  AFTER DELETE OR INSERT OR UPDATE OF nrozona, estadozona
  ON pessoa
  FOR EACH ROW
DECLARE
BEGIN
  /*trata cada um dos casos de alteracao da tabela*/
  IF DELETING THEN
    UPDATE zona SET qtdeleitoresz = qtdeleitoresz-1
      WHERE nrozona = :OLD.nrozona
        AND estadozona = :OLD.estadozona;
  ELSIF INSERTING THEN
    UPDATE zona SET qtdeleitoresz = qtdeleitoresz+1
      WHERE nrozona = :NEW.nrozona
        AND estadozona = :NEW.estadozona;
  ELSIF UPDATING THEN
    UPDATE zona SET qtdeleitoresz = qtdeleitoresz-1
      WHERE nrozona = :OLD.nrozona
        AND estadozona = :OLD.estadozona;
    UPDATE zona SET qtdeleitoresz = qtdeleitoresz+1
      WHERE nrozona = :NEW.nrozona
        AND estadozona = :NEW.estadozona;
  END IF;
END;
/
/*trigger para contagem de eleitores por secao*/
CREATE OR REPLACE TRIGGER eleitores_por_secao
  AFTER DELETE OR INSERT OR UPDATE OF nrozona, estadozona, nrosecao
  ON pessoa
  FOR EACH ROW
DECLARE
BEGIN
  /*trata cada um dos casos de alteracao da tabela*/
  IF DELETING THEN
    UPDATE secao SET qtdeleitoress = qtdeleitoress-1
      WHERE nrozona = :OLD.nrozona
        AND estadozona = :OLD.estadozona
        AND nrosecao = :OLD.nrosecao;
  ELSIF INSERTING THEN
    UPDATE secao SET qtdeleitoress = qtdeleitoress+1
      WHERE nrozona = :NEW.nrozona
        AND estadozona = :NEW.estadozona
        AND nrosecao = :NEW.nrosecao;
  ELSIF UPDATING THEN
    UPDATE secao SET qtdeleitoress = qtdeleitoress-1
      WHERE nrozona = :OLD.nrozona
        AND estadozona = :OLD.estadozona
        AND nrosecao = :OLD.nrosecao;
    UPDATE secao SET qtdeleitoress = qtdeleitoress+1
      WHERE nrozona = :NEW.nrozona
        AND estadozona = :NEW.estadozona
        AND nrosecao = :NEW.nrosecao;
  END IF;
END;
/
/*Atualiza o numero de votos para um partido ou candidato
                        utilizando atributos derivados*/
CREATE OR REPLACE TRIGGER votos_por_partido
  AFTER DELETE OR INSERT OR UPDATE OF nropartido
  ON votopartido
  FOR EACH ROW
DECLARE
BEGIN
  /*trata cada um dos casos de alteracao da tabela*/
  IF DELETING THEN
    UPDATE partido SET nrovotosp = nrovotosp-1
      WHERE nropartido = :OLD.nropartido;
  ELSIF INSERTING THEN
    UPDATE partido SET nrovotosp = nrovotosp+1
      WHERE nropartido = :NEW.nropartido;
  ELSIF UPDATING THEN
    UPDATE partido SET nrovotosp = nrovotosp-1
      WHERE nropartido = :OLD.nropartido;
    UPDATE partido SET nrovotosp = nrovotosp+1
      WHERE nropartido = :NEW.nropartido;
  END IF;
END;
/

CREATE OR REPLACE TRIGGER votos_por_candidato
  AFTER DELETE OR INSERT OR UPDATE OF nrotiteleitor
  ON votocandidato
  FOR EACH ROW
DECLARE
  cargo candidato.cargoCandidato%Type;
  nro candidato.nroCandidato%Type;
BEGIN
  /*trata cada um dos casos de alteracao da tabela*/
  IF DELETING THEN
    UPDATE candidato SET nrovotos = nrovotos-1
      WHERE nrotiteleitor = :OLD.nrotiteleitor;
      
  SELECT cargoCandidato, nroCandidato INTO cargo, nro
    FROM candidato WHERE( :OLD.nroTitEleitor = nroTitEleitor);
  
  DBMS_OUTPUT.PUT_LINE('TO_NUMBER(SUBSTR(TO_CHAR(nro), 1, 2))');
  
  IF(UPPER(cargo) = 'VEREADOR' OR UPPER(cargo) = 'SENADOR' OR UPPER(cargo) = 'DEPUTADO') THEN
    DELETE FROM votoPartido WHERE(
      nroPartido = TO_NUMBER(SUBSTR(TO_CHAR(nro), 1, 2)) AND
      nroZona = :OLD.nroZona AND
      estadoZona = :OLD.estadoZona AND
      nroSecao = :OLD.nroSecao AND
      nroUrna = :OLD.nroUrna AND
      idVotoP = :OLD.idVotoC
    );
  END IF;
  ELSIF INSERTING THEN
    UPDATE candidato SET nrovotos = nrovotos+1
      WHERE nrotiteleitor = :NEW.nrotiteleitor;

  SELECT cargoCandidato, nroCandidato INTO cargo, nro
      FROM candidato WHERE( :NEW.nroTitEleitor = nroTitEleitor);
  
  IF(UPPER(cargo) = 'VEREADOR' OR UPPER(cargo) = 'SENADOR' OR UPPER(cargo) = 'DEPUTADO')
    THEN INSERT INTO votoPartido VALUES(
      TO_NUMBER(SUBSTR(TO_CHAR(nro), 1, 2)), :NEW.nroZona, :NEW.estadoZona, :NEW.nroSecao, :NEW.nroUrna,:NEW.idVotoC);
  END IF;
  ELSIF UPDATING THEN
    UPDATE candidato SET nrovotos = nrovotos-1
      WHERE nrotiteleitor = :OLD.nrotiteleitor;
  
  SELECT cargoCandidato, nroCandidato INTO cargo, nro
    FROM candidato WHERE( :OLD.nroTitEleitor = nroTitEleitor);
  
  IF(UPPER(cargo) = 'VEREADOR' OR UPPER(cargo) = 'SENADOR' OR UPPER(cargo) = 'DEPUTADO')
    THEN DELETE FROM votoPartido WHERE(
      nroPartido = TO_NUMBER(SUBSTR(TO_CHAR(nro), 1, 2)) AND
      nroZona = :OLD.nroZona AND
      estadoZona = :OLD.estadoZona AND
      nroSecao = :OLD.nroSecao AND
      nroUrna = :OLD.nroUrna AND
      idVotoP = :OLD.idVotoC
    );
  END IF;
    UPDATE candidato SET nrovotos = nrovotos+1
      WHERE nrotiteleitor = :NEW.nrotiteleitor;
    
    SELECT cargoCandidato, nroCandidato INTO cargo, nro
      FROM candidato WHERE( :NEW.nroTitEleitor = nroTitEleitor);
  
    IF(UPPER(cargo) = 'VEREADOR' OR UPPER(cargo) = 'SENADOR' OR UPPER(cargo) = 'DEPUTADO')
      THEN INSERT INTO votoPartido VALUES(
        TO_NUMBER(SUBSTR(TO_CHAR(nro), 1, 2)), :NEW.nroZona, :NEW.estadoZona, :NEW.nroSecao, :NEW.nroUrna,:NEW.idVotoC);
    END IF;
  END IF;
END;
/

/*Solução usando compound trigger para insercao de voto em vice quando eh feito voto em candidato*/
DROP TABLE TEMP_VOTO;
CREATE TABLE TEMP_VOTO(
  nroTitEleitor VARCHAR2(12),
  nroZona NUMBER,
  estadoZona CHAR(2),
  nroSecao NUMBER,
  nroUrna NUMBER,
  idv NUMBER,
  remove NUMBER(1)
);

CREATE OR REPLACE TRIGGER trigger_votoVice 
  FOR INSERT OR DELETE OR UPDATE OF nroTitEleitor 
  ON VOTOCANDIDATO
  COMPOUND TRIGGER
  
  principal votoCandidato.NROTITELEITOR%Type;
  vice votoCandidato.NROTITELEITOR%Type;

  CURSOR temp IS
    SELECT nroTitEleitor, nroZona, estadoZona, nroSecao, nroUrna, idv, remove FROM temp_voto;
  tuple temp%RowType;
  temVice NUMBER;
  idv NUMBER;
  
  AFTER EACH ROW IS
  BEGIN
  IF inserting
    THEN
    principal := :NEW.nroTitEleitor;
  ELSE
    principal := :OLD.nroTitEleitor;
  END IF;
  
  SELECT count(*) INTO temVice
      FROM EhViceDe
      WHERE(
      nroTitEleitorPrincipal = principal
     );
  
  IF temVice = 1
    THEN
    SELECT nroTitEleitorVice INTO vice
      FROM EhViceDe
      WHERE(
      nroTitEleitorPrincipal = principal
     );
  
    IF INSERTING OR UPDATING THEN
        VALUES(vice, :NEW.nroZona, :NEW.estadoZona, :NEW.nroSecao, :NEW.nroUrna, :NEW.idVotoC, 0);
    END IF;
    IF UPDATING OR DELETING THEN
        VALUES(vice, :OLD.nroZona, :OLD.estadoZona, :OLD.nroSecao, :OLD.nroUrna,:OLD.idVotoC, 1);
    END IF;
  END IF;
      
  END AFTER EACH ROW;
  
  AFTER STATEMENT IS
  BEGIN
    OPEN temp;
    
    LOOP 
      FETCH temp INTO tuple;
      EXIT WHEN temp%NOTFOUND;
      DELETE FROM TEMP_VOTO WHERE (nroTitEleitor = tuple.nroTitEleitor);
    IF tuple.REMOVE = 0 THEN 
      
        VALUES(tuple.nroTitEleitor, tuple.nroZona, tuple.estadoZona, tuple.nroSecao, tuple.nroUrna, tuple.idv);
    ELSE
        DELETE FROM VOTOCANDIDATO WHERE(
      tuple.nroTitEleitor = nroTitEleitor AND
      tuple.nroZona = nroZona AND
      tuple.estadoZona = estadoZona AND
      tuple.nroSecao = nroSecao AND
      tuple.nroUrna = nroUrna AND
      tuple.idv = idVotoC
    );
    END IF;
    END LOOP;
  END AFTER STATEMENT;
  
END trigger_votoVice;
