/*Cria pacote para as funcoes do banco de dados das eleicoes*/
CREATE OR REPLACE PACKAGE eleicoes IS
  /*procedimento que atualiza tabela candidatoEleito com os N (numero passado como parametro) vereadores mais votados 
  e o prefeito e vice mais votados*/
  PROCEDURE atualiza_eleitos(numVereadores IN NUMBER, localizacao IN VARCHAR);
  
  /*para os relatorios*/
  TYPE TUPLA IS RECORD (
    nome VARCHAR2(100),
    zona NUMBER,
    estado CHAR(2),
    nVotos NUMBER
  );

  TYPE TABELA IS TABLE OF TUPLA;
    
  /*Gera relatório do número de votos de cada candidato, em cada zona eleitoral e estado, e agregações*/
  FUNCTION relatorio_votos_candidatos RETURN TABELA PIPELINED;
  
  /*Gera relatório do número de votos de cada partido, em cada zona eleitoral e estado, e agregações, considera apenas partido com mais que N votos*/
  FUNCTION relatorio_votos_partidos(nVotos IN NUMBER) RETURN TABELA PIPELINED;
END eleicoes;
/

CREATE OR REPLACE PACKAGE BODY eleicoes IS
  FUNCTION relatorio_votos_candidatos RETURN TABELA PIPELINED IS
    CURSOR votos IS
      SELECT CANDIDATO.NOMEFANTASIA "NOME", ZONA.NROZONA "ZONA", ZONA.ESTADOZONA "ESTADO", COUNT(*) "NVOTOS"
        FROM CANDIDATO, VOTOCANDIDATO, ZONA
        WHERE CANDIDATO.NROTITELEITOR = VOTOCANDIDATO.NROTITELEITOR
          AND VOTOCANDIDATO.NROZONA = ZONA.NROZONA
          AND VOTOCANDIDATO.ESTADOZONA = ZONA.ESTADOZONA
        GROUP BY ROLLUP(CANDIDATO.NOMEFANTASIA, ZONA.ESTADOZONA, ZONA.NROZONA)
        ORDER BY ZONA.NROZONA, ZONA.ESTADOZONA, CANDIDATO.NOMEFANTASIA;
    results TUPLA;
  BEGIN
    OPEN votos;
    
    LOOP
      FETCH votos INTO results;
      EXIT WHEN votos%NotFound;
      
      PIPE ROW (results);
    END LOOP;
    
    CLOSE votos;
    return;
  END relatorio_votos_candidatos;
  
  FUNCTION relatorio_votos_partidos(nVotos IN NUMBER) RETURN TABELA PIPELINED IS
    CURSOR votos IS
      SELECT PARTIDO.SIGLAPARTIDO "NOME", ZONA.NROZONA "ZONA", ZONA.ESTADOZONA "ESTADO", COUNT(*) "NVOTOS"
        FROM PARTIDO, VOTOPARTIDO, ZONA
        WHERE PARTIDO.NROPARTIDO = VOTOPARTIDO.NROPARTIDO
          AND VOTOPARTIDO.NROZONA = ZONA.NROZONA
          AND VOTOPARTIDO.ESTADOZONA = ZONA.ESTADOZONA
        GROUP BY ROLLUP(PARTIDO.SIGLAPARTIDO, ZONA.ESTADOZONA, ZONA.NROZONA)
        HAVING COUNT(VOTOPARTIDO.NROPARTIDO) > nVotos
        ORDER BY ZONA.NROZONA, ZONA.ESTADOZONA, PARTIDO.SIGLAPARTIDO;
    
    results TUPLA;
  BEGIN
    OPEN votos;
    
    LOOP
      FETCH votos INTO results;
      EXIT WHEN votos%NotFound;
  
      PIPE ROW(results);
    END LOOP;
    
    CLOSE votos;
    return;
  END relatorio_votos_partidos;

  PROCEDURE atualiza_eleitos( numVereadores IN NUMBER, localizacao IN VARCHAR) IS
    /*cursor que vai ser usado pra recuperar os vereadores*/
    CURSOR candidatoC IS
      SELECT pessoa.nroTitEleitor, nomeFantasia, cargoCandidato, nroVotos, zona.endZona AS zona, secao.localSecao AS secao
      FROM candidato, pessoa, zona, secao
        WHERE(
          cargoCandidato = 'VEREADOR' AND
          candidato.nroTitEleitor = pessoa.nroTitEleitor AND
          pessoa.nroZona = secao.nroZona AND
          pessoa.estadoZona = secao.estadoZona AND
          pessoa.nroSecao = secao.nroSecao AND
          secao.nroZona = zona.nroZona AND
          secao.estadoZona = zona.estadoZona
        ) ORDER BY nroVotos DESC;
    tuplaCandidato candidatoC%RowType;
  
    x NUMBER := 1;
    prefeito CANDIDATO.NROTITELEITOR%Type;
    vice CANDIDATO.NROTITELEITOR%Type;
    stringPref CONSTANT CANDIDATO.CARGOCANDIDATO%TYPE := 'PREFEITO';
    stringVice CONSTANT CANDIDATO.CARGOCANDIDATO%TYPE := 'VICE-PREFEITO';
BEGIN    
    OPEN candidatoC;
    DELETE FROM CANDIDATOELEITO;
    
    /*insere os N primeiros vereadores na tabela candidatoEleito*/
    LOOP
      FETCH candidatoC INTO tuplaCandidato;
      EXIT WHEN candidatoC%NotFound OR x > numVereadores;
      IF(UPPER(tuplaCandidato.secao) LIKE UPPER('%' || localizacao) OR UPPER(tuplaCandidato.zona) LIKE UPPER('%'||localizacao)) THEN
    x := x+1;
    END IF;
    END LOOP;
    CLOSE candidatoC;
    
    /*busca titulo do vice eleito*/
    SELECT candidato.nroTitEleitor
      INTO vice
      FROM candidato, pessoa, zona, secao
      WHERE(
        cargoCandidato = stringVice AND
        candidato.nroTitEleitor = pessoa.nroTitEleitor AND
        pessoa.nroZona = secao.nroZona AND
        pessoa.estadoZona = secao.estadoZona AND
        pessoa.nroSecao = secao.nroSecao AND
        secao.nroZona = zona.nroZona AND
        secao.estadoZona = zona.estadoZona AND
        (UPPER(localSecao) LIKE UPPER('%' || localizacao) OR UPPER(endZona) LIKE UPPER('%'||localizacao)) AND
        nroVotos = (
          SELECT max(nroVotos)
            FROM candidato
            WHERE(
              cargoCandidato = stringVice
            )
        )
      );
      
    /*usa o titulo do vice para encontrar o do prefeito eleito*/
    SELECT nroTitEleitorPrincipal
      INTO prefeito
      FROM ehViceDe
      WHERE(
        nroTitEleitorVice = vice
      );
      
    /*insere prefeito e vice em candidatoEleito*/
    
    COMMIT;
  END;
END;
/

/*Cria visao que mantem informacoes dos candidatos eleitos*/
DROP MATERIALIZED VIEW candidatos_eleitos;
CREATE MATERIALIZED VIEW candidatos_eleitos
  BUILD IMMEDIATE
  REFRESH COMPLETE ON COMMIT
  ENABLE QUERY REWRITE
  AS
  SELECT candidato.nroTitEleitor, nomeFantasia, cargoCandidato, nroVotos
  FROM candidato, candidatoEleito
  WHERE(
    candidato.nroTitEleitor = candidatoEleito.nroTitEleitor
  ) ORDER BY nroVotos DESC;

  COMMIT;
